import styled from "@emotion/styled";

export default function List() {
  return (
    <Container>
      <Header>최재열 멍청이</Header>
      <Contents />
    </Container>
  );
}

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 100%;
`;

const Header = styled.div`
  position: sticky;
  top: 0;
  height: 20px;
`;

const Contents = styled.div`
  flex-grow: 1;
`;
